const std = @import("std");

pub fn Recursive(comptime T: type) type {
    return struct {
        pub fn sumOfProducts(items: []const T, r: usize) T {
            const n = items.len;
            //handle simple r==1 and r==n cases
            //not necessary tiny optimization
            if (r == 1) {
                return r1(items);
            } else if (r == n) {
                return rn(items);
            }
            //all other cases
            return rec(items, r - 1, n, 1);
        }

        fn rec(items: []const T, start_pos: usize, end_pos: usize, prod: T) T {
            var s: T = 0;
            var i = start_pos;
            while (i < end_pos) : (i += 1) {
                const new_prod = prod * items[i];
                s += if (start_pos == 0) new_prod else rec(items, start_pos - 1, i, new_prod);
            }
            return s;
        }

        fn r1(items: []const T) T {
            var s: T = items[0];
            var i: usize = 1;
            while (i < items.len) : (i += 1) {
                s += items[i];
            }
            return s;
        }

        fn rn(items: []const T) T {
            var s = items[0];
            var i: usize = 1;
            while (i < items.len) : (i += 1) {
                s *= items[i];
            }
            return s;
        }
    };
}

const expectEqual = std.testing.expectEqual;

test "2/4" {
    const items = [_]usize{ 1, 2, 3, 4 };
    try expectEqual(Recursive(usize).sumOfProducts(&items, 2), 35);
    try expectEqual(Iterative(usize).sumOfProducts(&items, 2), 35);
}

test "3/5" {
    const items = [_]usize{ 1, 2, 3, 4, 5 };
    try expectEqual(Recursive(usize).sumOfProducts(&items, 3), 225);
    try expectEqual(Iterative(usize).sumOfProducts(&items, 3), 225);
}

test "all data rows" {
    const test_data = @import("test_data.zig").data;
    const binomial = @import("binomial.zig").binomial;

    for (test_data) |d| {
        const p = Iterative(f64).sumOfProducts(d.prices, d.r);
        const w = p * d.stake / @intToFloat(f64, binomial(d.r, d.prices.len));
        try std.testing.expect(@fabs(w - d.winning) < 0.1);

        const pr = Recursive(f64).sumOfProducts(d.prices, d.r);
        const wr = pr * d.stake / @intToFloat(f64, binomial(d.r, d.prices.len));
        try std.testing.expect(@fabs(wr - d.winning) < 0.1);
    }
}

test "number of multiplications" {
    const binomial = @import("binomial.zig").binomial;

    const s = struct {
        fn multiplications(rc: usize, nc: usize) usize {
            var r = rc;
            var n = nc;
            var s: usize = 0;
            while (r > 1) : ({
                r -= 1;
                n -= 1;
            }) {
                s += binomial(r, n);
            }
            return s;
        }
    };

    var n: usize = 3;
    while (n <= 20) : (n += 1) {
        var r: usize = 2;
        while (r < n) : (r += 1) {
            const brute_force = binomial(r, n) * (r - 1); // number of multiplications in brute force algorithm
            const this = s.multiplications(r, n); // and in this algorithm

            std.debug.print("{d}|{d}({d}) {d} {d} diff: {d} {d:.2}\n", .{
                n,
                r,
                binomial(r, n),
                brute_force,
                this,
                brute_force - this,
                @intToFloat(f64, this) / @intToFloat(f64, brute_force) * 100,
            });
        }
    }
}

